import React from "react";

import s from "./AddNewTicket.module.css";

const AddNewTicket = () => {
  return (
    <form className={s.container}>
      <h2 className={s.title}>Add New Task</h2>
      <div className="input_container">
        <h3>Title</h3>
        <input type="text" placeholder="e.g Tasks coffee break" />
      </div>
      <div className="input_container">
        <h3>Description</h3>
        <input
          type="text"
          placeholder="e.g it is always good to take a break. This 15 minute break will recharge the batteries a little"
        />
      </div>
      <div className="input_container">
        <h3>Status</h3>

        <select id="">
          <option value="Todo">Todo</option>
          <option value="Doing">Doing</option>
          <option value="Done">Done</option>
        </select>
      </div>
      <button>Create Task</button>
    </form>
  );
};

export default AddNewTicket;
